You meet Ernie, you can&#39;t help but fall in love with him.&nbsp; Ernie was a stray hanging out around one of our volunteer&#39;s neighborhoods.&nbsp; She took him to the vet to be neutered and found out he&#39;s FIV+.&nbsp; Ernie should live in a home so he will have a less stressful life than on the streets.&nbsp;

&nbsp;

Ernie is in a foster home at this time.&nbsp; He gets along with dogs and cats.&nbsp; If you&#39;d like to meet him, fill out our online adoption application at:&nbsp; https://colonycats.org/adoption_app.html . He&#39;s neutered, microchipped, FL negative and up to date on vaccines.&nbsp; DOB&nbsp; Feb 2014

&nbsp;




For more information about FIV &ndash; feline immunodeficiency virus visit this website: https://bestfriends.org/resources/fiv-cats-faqs-feline-immunodeficiency-virus




GW

Ted is a petite brindle boy with lots of love to give. He loves to just cuddle on the couch with his person and sleep or he loves to&nbsp;be outside going for a walk. He loves kids, and with a slow introduction to dogs, he has done well.&nbsp;


He doesn&#39;t need to be crated during the day so&nbsp;if he is&nbsp;left out with his fur siblings, he does amazing. He hasn&#39;t been cat tested, so we aren&#39;t sure how he would react.&nbsp;

&nbsp;

He is all together a wonderful dog. He&#39;s excelled well with his foster family and neighbors kids.&nbsp;

Meet Stu! He&#39;s a great dog with a big heart and whose favorite things to do is cuddle and receive belly rubs. He can be playful too so a fenced yard would be a plus but is not required, with a couple quick walks each day he does just fine. Stu currently lives with two other dogs and is fine most of the time &quot;occasionally rude to male&quot; but he does not do well with cats. He is food reactive and would do best in a home with kids 13 yrs. or older. He has some separation anxiety but that has been easy managed with proper medication. Stu is very well socialized with people, is eager to please and is food motivated. He is smart and responds well to training. He knows sit, wait, release command (&ldquo;okay&rdquo;) and does well on a harness lead for walks. He is about 6.5 years old and crate and house trained.

Stu&rsquo;s adoption fee is $175; he is neutered, microchipped, and up-to-date on all of his vaccines. If you are interested in meeting Stu, please contact us at adoption@ihadro.org or, you can find an adoption application at www.ihadro.org/forms

&nbsp;

Jackson is young handsome boy looking for a person to throw his ball! Would that be you?&nbsp;


Here are some fun facts about Jack(son)!&nbsp;

-Jackson knows sit, down and roll over. He is super smart and very eager to learn more.

-Jackson loves toys- balls, Kong&rsquo;s, squeaky toys, you name it!! He can entertain himself for hours!&nbsp;

-Jackson is a fun and goofy boy. You will be guaranteed to laugh with him!&nbsp;

-Jackson also enjoys car rides, laying in the sun and giving slobbery kisses!&nbsp;


In the shelter, Jackson was in play group with other dogs. He will need a dog companion to be patient and someone that will show him the ropes! He should be in the house with older children, as he is a big strong boy and no kitties. He is looking for an owner who wants to put as much love into him as he has to give. Can you give Jackson a chance?&nbsp;


Adoption applications can be found at&nbsp;
www.ihadro.org


&nbsp;

Rasputin is one of our favorite guys! Rasputin is FIV+. We don&#39;t know much about his back story, but he&#39;s been an excellent role model for the other cats in the FIV room since he came to us a few years ago. His favorite hobbies include sleeping in his favorite cubby and watching people and the occasional dog walk past the big window. 
(DOB 4/1/16)&nbsp;&nbsp;


**If interested in adopting me, please fill out an online adoption application at&nbsp;http://colonycats.org/adoption_app.html&nbsp;to expedite the process.&nbsp;&nbsp;Due to the large number of inquiries received, we are unable to respond to emails quickly.**

Louie&#39;s adoption donation is $300&nbsp;has been neutered, microchipped, received his rabies, distemper/parvo, bordetella&nbsp;and flu vaccinations, tested negative for heartworms and has started on prevention, as well as flea protection. He also has had a dental cleaning.

Louie was surrendered to a shelter for unknown reasons. Upon rescuing him, it was discovered he had a heart murmur. After a consultation with a cardiologist, Louie was diagnosed with several heart defects. Surgery was being considered until he was then diagnosed with a possible liver shunt. It was then decided to not do surgery. Louie&#39;s life expectancy is really unknown but with known medical issues he has been stable with us and has done very well.&nbsp; He had been with a foster home but unfortunately she could no longer care for him.&nbsp; Since he has been stable with regular monitoring, we are making available for adoption.

Louie has personality plus! He is a &quot;talker&quot; and is so enthusiastic about life! Squeaky toys are his favorite.&nbsp;Louie&nbsp; is also a little love bug and loves to cuddle with his people. He will snuggle right under your chin so he can lay his head on your heart.&nbsp;Louie is a &quot;typical &quot; miniature poodle as he&nbsp;can be protective. Louie loves food and has no problem trying to take food from any other dog so he is best to feed by himself. A home with older children is preferred. .&nbsp;

Louie does very well on house training if kept on a schedule. He likes to be outside but he is not a long walker as he tires easily. This little guy gets along with other dogs, but does do better with females than he does males.&nbsp;Louie is just adorable and anyone would fall in love with this lil guy.&nbsp;

&nbsp;

Nanna came to us with her litter of kittens.&nbsp; Her babies have been adopted and now it is her turn.&nbsp; She&rsquo;s spayed, vaccinated, microchipped, and tested FIV/FeLV negative and ready for a family to call her own. DOB August 2016.&nbsp; She&rsquo;s currently in foster care but will be coming to adoption events at Petco in Upper Arlington on the corner of Reed and Henderson Roads on Saturdays from noon till 4PM.&nbsp;

If you are interested in 
 adopting me, please visit Petco Upper Arlington during our Saturday adoption event or fill out an online adoption application at&nbsp;

https://colonycats.org/adoption_app.html&nbsp;

to expedite the process. 



Due to the large number of inquiries received, we are unable to respond to emails quickly.



GHW

Meet Apollo! &hearts;️Apollo is such a sweetheart!! He&rsquo;ll stand on his back legs and wave his paws when he gets excited--cutest thing ever!!&nbsp;He loves attention, other&nbsp;dogs and cats with proper introduction. We believe he will be fine with children but has not been around children since coming to the rescue. He is not a fan of the crate at all and gets very upset if crated, but he&rsquo;s good to leave out.&nbsp;He does alert bark to loud outdoor noises and a doorbell so he may not be the right dog for an apartment/condo.Apollo and his brother, Levi came to the rescue together but they do well separately and do not need to be adopted together.&nbsp;We&nbsp;think they may have been neglected or mistreated but they are doing so much better in their foster home!&nbsp;
If you are interested in adopting Apollo please fill out an application: https://dashrescue.rescuegroups.org/info/adoption
Email: dashrescue00@gmail.com for any questions that you might have!

Opie was rescued from a life of being chained outside 24/7 his entire life.&nbsp; At 10.5 years of age he now has a new leash on life.&nbsp; He has quickly learned that living indoors is amazing and he has caught on with no problem.&nbsp; He&#39;s smart, crate trained, good on a leash and loves walks, housebroken, doesn&#39;t bark much and loves attention and pets.&nbsp; Opie cannot live with cats as he hasn&#39;t quite figured out that you don&#39;t chase them.&nbsp; He&#39;s a shepherd mix at about 50 lbs.&nbsp; Opie is neutered, microchipped, heartworm negative and up to date on vaccines. He is dog selective - likes some, not others.&nbsp; While Opie may be considered a senior dog, he sure doesn&#39;t act it.

I am in a foster home so if you are interested in adopting me, please fill out an online adoption application at https://colonycats.org/adoption_app.html to expedite the process.&nbsp; Due to the large number of inquiries we receive, we are unable to respond to emails quickly.

&nbsp;

Hi, my name is Jeremiah Joe.&nbsp; I am a gentle laid back beagle who would love to lay around with you on the couch.&nbsp; I don't mind if there are other dogs in the house, I will share some space for them as well.&nbsp; I am crate trained and will let you know when I need some attention by giving ya the ole beagle bark.&nbsp; I do love attention and would love to find my forever home where we can keep each other company and be best buds. Please put in an application or email so we can get together soon. &nbsp;
Application: www.dashanimalrescue.org
Questions?! Please email dashanimalrescue00@gmail.com

Qtip&rsquo;s adoption donation is $400 and he is being fostered in Central Ohio.&nbsp; He has been neutered, microchipped, received his rabies, distemper/parvo, bivalent canine influenza, and Bordetella vaccines, tested negative for heartworms and started on heartworm/flea/tick prevention.&nbsp;He has also had a dental cleaning.

Qtip came into rescue when his previous owner could no longer care for him and he was re-homed but his activity level was too much for the resident dog.&nbsp;&nbsp;

Qtip definitely loves to play with other dogs similar to his size. He sometimes gets a bit greedy when it comes to getting pets from his people but he just loves his humans! Qtip loves to use his little voice to let you know if someone is at the door, or across the street on a walk but he is very friendly when meeting new friends (human or canine). Qtip hasn&#39;t been kid or cat tested.&nbsp;

Qtip is definitely a lap dog. He loves cuddling at night in bed with his people, on the couch, really anywhere his people are he likes to be. He hasn&#39;t been trained much on a leash but he loves to go for walks to sniff. He knows to sit and his name, but he would like his new family to teach him more tricks as long as they provide yummy treats. Qtip is potty trained and crate trained and will bark at you if he needs to use the potty.&nbsp;

Qtip would be great in an only pup home or a home with other dogs. Once he learns the dog dynamic he adjusts pretty easily to any home situation. Qtip is such a sweet, loving, happy dog and is ready for his forever family to love him for the rest of his life!&nbsp;

Delani&rsquo;s adoption donation is $475 and she is being fostered in Central Ohio.&nbsp; She has been spayed, microchipped, received her rabies, distemper/parvo, bivalent canine influenza, and bordetella vaccines, tested negative for heartworms and started on heartworm/flea/tick prevention. 
Delani requires a secure, physically fenced yard.


Delani came into rescue as a breeder release from a commercial puppy mill and has made incredible progress in rescue.&nbsp; She is still skittish and learning to walk on a leash (so the fenced yard requirement is a must have) but she is an incredibly happy, happy, happy girl who becomes attached to her people fairly quickly.&nbsp; Delani is an active girl and would be best in a home where someone is home a fair amount to continue her progress moving forward.&nbsp; She does well with children but we believe that a home with children over the age of 8 would be best because she is rambunctious and very playful.&nbsp;

Dogs posted are currently up for adoption unless otherwise noted.&nbsp; Our goal is to match dogs with a suitable home/family so that at any time, dogs shown here may already have a potential match.&nbsp; We post dogs as quickly as possible however there may be some not yet pictured. We allow our dogs time to settle in with their foster families so that we can evaluate their health and personality.&nbsp; &nbsp;Sparky is 3 yrs old and&nbsp;
&nbsp;a Collie Aussie mix who has attributes of both breeds.&nbsp; He is friendly, cuddly, smart and curious.&nbsp; He enjoys toys but likes humans even more.&nbsp; He is excited to meet any human that crosses his path and wants to know where his family of humans is, preferring to be near them.&nbsp;

&nbsp;

He plays exuberantly with his foster doggie siblings and would probably enjoy being the only dog or else with a dog who is active and non-dominant.&nbsp; He is working on commands and walking politely on a leash.&nbsp; He is crate trained and sleeps and eats in his crate as he did at his former owner&rsquo;s home.&nbsp; He rides well in the car with a bit of help to get in but he might bark at large trucks or motorcycles.&nbsp; His energy and attentiveness we believe would make him a prime candidate for agility training and he would love being part of an active family. He is very interested in squirrels and rabbits so needs to be leashed or have a fenced in yard.&nbsp; He has not been around cats or children.&nbsp; He would do best with&nbsp; a savvy dog owner who is going to capitalize on his strengths and he in turn will be your faithful, eager companion.


&nbsp;The adoption fee for Dixie is $250.00
